import React from 'react';
import { Link, withRouter } from "react-router-dom";

$(document).ready(function() {
  var active = false;

  function toggleNav() {
    if (active) {
      $('#nav').animate({"width":"0%"}, 300)
      setTimeout(function() {
        $('.nav-item').hide();
        $('#nav').removeClass('shadow');
      }, 250);
    } else {
      $('#nav').addClass('shadow').animate({"width":"600px"}, 300);
      $('.nav-item').show();
    }
  };

  $('#button').on('click', function() {

    toggleNav();
    active = !active;
  });
});
class NewNav extends React.Component{

