    </div>
    <div id="nav">
      <div id="nav-item-container">
        <div class="nav-item">contact</div>
        <div class="nav-item">work</div>
        <div class="nav-item">about</div>
        </div>
      </div>
    </div>
  </div>
)
}
}
export default NewNav;
